  <script src="https://unpkg.com/leaflet/dist/leaflet.js">
let allMarkers = [];

function filterMarkers() {
  const nameFilter = document.getElementById('searchName').value.toLowerCase();
  const addressFilter = document.getElementById('searchAddress').value.toLowerCase();

  allMarkers.forEach(marker => {
    const matchesName = marker.name.includes(nameFilter);
    const matchesAddress = marker.address.includes(addressFilter);
    if (matchesName && matchesAddress) {
      marker.addTo(markerClusterGroup);
    } else {
      markerClusterGroup.removeLayer(marker);
    }
  });
}

</script>

function filterMarkers() {
  const nameFilter = document.getElementById('searchName').value.toLowerCase();

      marker.addTo(markerClusterGroup);

      markerClusterGroup.removeLayer(marker);
    }
  });
